import React, { useState, useEffect } from "react";
import { addProduct } from "../../../API/api";
import { useNavigate } from "react-router-dom";
import "./AddProduct.css";
const AddProduct = () => {
  const [selectedCategory, setSelectedCategory] = useState("");
  const [product, setProduct] = useState({
    id: 0,
    image: null,
    name: "",
    rating: [0, 0, 0, 0, 0],
    price: 0,
    quantity: 0,
  });

  useEffect(() => {
    console.log(product);
  }, [product]);

  const handleInputChange = (e) => {
    console.log(e.target.name);
    setProduct({ ...product, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    console.log("product");
    e.preventDefault();
    addProduct(product);
  };

  const handleImage = (e) => {
    setProduct({ ...product, [e.target.name]: e.target.files[0] });
    console.log(product);
  };

  const Navigate = useNavigate();

  const BackButton = () => {
    Navigate("/Admin");
  };

  // const handleSubmit = async (e) => {
  //   e.preventDefault();

  //   const formData = new FormData();
  //   formData.append("title", product.title);
  //   formData.append("price", product.price);
  //   formData.append("description", product.description);
  //   formData.append("image", product.image);
  //   formData.append("rating[rate]", product.rating.rate);
  //   formData.append("rating[count]", product.rating.count);

  //   await addProduct(formData);
  // }

  return (
    <div className="ContainerAdd">
      <h2>Add a New Product</h2>
      <form onSubmit={handleSubmit} className="product-form">
        <div className="form-group">
          <label htmlFor="name">Name:</label>
          <input
            type="text"
            className="form-control"
            id="name"
            name="name"
            value={product.name}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="price">Price:</label>
          <input
            type="number"
            className="form-control"
            id="price"
            name="price"
            value={product.price}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="quantity">Quantity:</label>
          <input
            type="number"
            className="form-control"
            id="quantity"
            name="quantity"
            value={product.quantity}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="image">Image:</label>
          <input
            type="file"
            className="form-control-file"
            id="image"
            name="image"
            onChange={handleImage}
            
          />
        </div>
        <div className="form-group">
          <label htmlFor="rating">Rating:</label>
          <div>
            {product.rating.map((rate, index) => (
              <input
                type="number"
                className="form-control-rating"
                id={`rating-${index}`}
                name={`rating-${index}`}
                key={`rating-${index}`}
                value={rate}
                onChange={(e) => {
                  const updatedRating = [...product.rating];
                  updatedRating[index] = parseInt(e.target.value);
                  setProduct({ ...product, rating: updatedRating });
                }}
                min="0"
                max="5"
                required
              />
            ))}
          </div>
        </div>
        <button type="submit" className="btn btn-primary">
          Add Product
        </button>
        <button onClick={BackButton} className="btn btn-primary">
          Back
        </button>
      </form>
    </div>
  );
};

export default AddProduct;
